import { IonBadge, IonButton, IonCol, IonContent, IonGrid, IonHeader, IonItem, IonLabel, IonPage, IonRouterLink, IonRow, IonSelect, IonSelectOption, IonText, IonTitle, IonToolbar } from '@ionic/react';
import React, { useRef, useState } from 'react';

import '../../css/Global.css';
import '../../css/Study@SIMProgList.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFilter } from '@fortawesome/free-solid-svg-icons';

import TopNav from '../../components/TopNav';
import Menu from '../../components/Menu';


const StudySIMProgList: React.FC = () => {
    

    return (
        <IonPage>
            <IonHeader>
                <TopNav title="Study@SIM" route='/u/home' backarrow={ true } hamburger = { true }/>
            </IonHeader>

            <IonContent fullscreen={true} id="studySIMProgListContent">
                <IonGrid id="studySIMProgListGrid">

                    <IonRow id="studySIMProgListHeaderRow" class="ion-align-items-center">
                        <IonCol size="6" sizeSm="6" class="ion-text-left" className="studySIMProgListCol">
                            <IonTitle className="studyProgListTitle">Programme Discipline here</IonTitle>
                        </IonCol>

                        <IonCol size="4" sizeSm="4" class="ion-text-right" className="studySIMProgListCol">
                            <IonButton id="compareBtn" fill="clear">
                                <IonLabel className="compareLabel">Compare</IonLabel>
                                <IonBadge id="compareBadge">1</IonBadge>
                            </IonButton>
                        </IonCol>

                        <IonCol size="2" sizeSm="2" class="ion-text-center" className="studySIMProgListCol">
                            <IonButton id="filterBtn" fill="clear">
                                <FontAwesomeIcon className="filterIcon" size="lg" icon={faFilter} />
                            </IonButton>
                        </IonCol>
                    </IonRow>

                    {/* Programme List */}
                    <IonRow className="studySIMProgListRow">
                        <IonCol className="studySIMProgListColDetails">
                            <IonRow>
                                <IonTitle id="progCourseTitle">Announcement Title</IonTitle>
                            </IonRow>

                            <IonRow>
                                <IonLabel id="announcementDate">Posted on (21 Novemeber 2020 (Sat)), (time)</IonLabel>
                            </IonRow>

                            <IonRow>
                                <IonLabel id="announcementDetails">Feeling abit snacky after the talks? Come on down to Block B to redeem free popcorns and candy floss! While stock lasts!</IonLabel>
                            </IonRow>

                        </IonCol>
                    </IonRow>
                    

                </IonGrid>
            </IonContent>
        </IonPage>
    );
};

export default StudySIMProgList;
